INSERT INTO `carehub_diaseases` (`diaseases_id`, `diaseases_name`, `diaseases_description`, `diaseases_dob`, `status`, `create_on`, `update_on`) VALUES
(1, 'Malaria', 'Malaria is caused by the Plasmodium parasite. The parasite can be spread to humans through the bites of infected mosquitoes.', '1888-11-06', 1, '2017-07-26 09:26:45', '2017-07-26 09:26:45'),
(2, 'Dengue fever', 'Dengue (pronounced DENgee) fever is a painful, debilitating mosquito-borne disease caused by any one of four closely related dengue viruses. These viruses are related to the viruses that cause West Nile infection and yellow fever', '0000-00-00', 1, '2017-07-26 09:26:45', '2017-07-26 09:26:45'),
(3, 'Rabies', 'Rabies infection is caused by the rabies virus. The virus is spread through the saliva of infected animals. Infected animals can spread the virus by biting another animal or a person. In rare cases, rabies can be spread when infected saliva gets into an open wound or the mucous membranes, such as the mouth or eyes.', '0000-00-00', 1, '2017-07-26 09:32:15', '2017-07-26 09:32:15'),
(4, 'Arthritis', 'An infection or injury to the joints can exacerbate this natural breakdown of cartilage tissue. Your risk of developing OA may be higher if you have a family history of the disease. Another common form of arthritis, RA, is an autoimmune disorder. It occurs when your body''s immune system attacks the tissues of the body.', '0000-00-00', 1, '2017-07-26 09:32:15', '2017-07-26 09:32:15'),
(5, 'Avian Influenza', 'Bird flu, also called avian influenza, is a viral infection that can infect not only birds, but also humans and other animals. ... H5N1 is the most common form of bird flu. ... Although there are several types of bird flu, H5N1 was the first avian influenza virus to infect humans.', '0000-00-00', 1, '2017-07-26 09:33:25', '2017-07-26 09:33:25'),
(6, 'Cancer.', ' cancers are related to environmental, lifestyle, or behavioral exposures.[1] The term "environmental", as used by cancer researchers, refers to everything outside the body that interacts with humans.', '0000-00-00', 1, '2017-07-26 09:37:32', '2017-07-26 09:37:32'),
(7, 'common cold', 'Although many types of viruses can cause a common cold, rhinoviruses are the most common culprit. A cold virus enters your body through your mouth, eyes or nose. The virus can spread through droplets in the air when someone who is sick coughs, sneezes ', '0000-00-00', 1, '2017-07-26 09:37:32', '2017-07-26 09:37:32'),
(8, 'Typhoid.', 'Typhoid fever is an acute illness associated with fever caused by the Salmonella typhi bacteria. It can also be caused by Salmonella paratyphi, a related bacterium that usually causes a less severe illness. ', '0000-00-00', 1, '2017-07-26 09:40:56', '2017-07-26 09:40:56'),
(9, 'tetanus', 'Tetanus is caused by an infection with the bacterium Clostridium tetani, which is commonly found in soil, saliva, dust, and manure. The bacteria generally enter through a break in the skin such as a cut or puncture wound by a contaminated object.', '0000-00-00', 1, '2017-07-26 09:40:56', '2017-07-26 09:40:56'),
(10, 'tonsils', 'Tonsillitis can occur at any age and is a common childhood infection. ... Symptoms include a sore throat, swollen tonsils, and fever. This condition is contagious and can be caused by a variety of common viruses and bacteria, such as Streptococcal bacteria, which causes strep throat.', '0000-00-00', 1, '2017-07-26 09:42:50', '2017-07-26 09:42:50'),
(11, 'Diarrhea', 'Contaminated food or water can transmit bacteria and parasites to your body. Parasites such as Giardia lamblia and cryptosporidium can cause diarrhea. ', '0000-00-00', 1, '2017-07-26 09:42:50', '2017-07-26 09:42:50'),
(13, 'Jaundice', ' Jaundice is caused by the inability of the newborn''s immature liver to process bilirubin from the accelerated breakdown of red blood cells that occurs at this age.', '0000-00-00', 1, '2017-07-26 09:44:06', '2017-07-26 09:44:06');
